import React from "react";
import Nitin from './Nitin.jpg'

const Home = () => {
  return (
    <>
      <div className="container d-flex my-5">
        <div className="container text-center">
        Hey , I am <span class="text-primary">Nitin Patil</span>
                <div>And I am Passionate </div>
                <span id="element" class="text-primary"></span>
        </div>
        <div className="container text-center">
           <img src={Nitin} alt="Nitin_Img" style={{width:"50%", borderRadius:"50%"}}/>
        </div>
      </div>
    </>
  );
};

export default Home;
